import React, { Component } from 'react';

function Card(props){
  return (
      <div className= "card">
        <div className="question-area">
          <h2> {props.Question} </h2>
        </div>
        <div className="input-area">
        <input/>
        <br/>
        <button className="complete"> Check Answer </button>
        </div>
        <h6> {props.Difficulty} </h6>
      </div>
      );


}


export default Card;
